contracts/vesting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0; 

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Vesting{
    uint public slicePeriod;
    uint public cliff;
    uint public duration;
    uint public tokensReleased;
    uint public startTime;
    address public owner;
    IERC20 public token;
    mapping(address => uint) public beneficiaries;
    mapping(address => uint) public noOfVestedTokens;

    constructor(address[] memory _beneficiaries, uint _slicePeriod, uint _cliff, uint _duration, address _token, uint _startTime) {
        require(_beneficiaries.length > 0, "No beneficiaries provided");
        require(_duration > 0, "Duration should be greater than zero");
        require(_cliff <= _duration, "Cliff period should be less than or equal to duration");

        slicePeriod = _slicePeriod;
        cliff = _startTime + _cliff;
        duration = _duration;
        token = IERC20(_token);
        owner = msg.sender;
        startTime = _startTime;

        for (uint i = 0; i < _beneficiaries.length; i++) {
            beneficiaries[_beneficiaries[i]] = token.balanceOf(address(this));
        }
    }

    modifier isOwner() {
        require(msg.sender == owner, "Only owner allowed");
        _;
    }

    modifier isBeneficiary() {
        require(beneficiaries[msg.sender] > 0, "Only beneficiary allowed");
        _;
    }

    modifier cliffPeriodDone() {
        require(block.timestamp >= cliff, "Cliff period not done");
        _;
    }

    function addBeneficiary(address _newBeneficiary, uint _tokensToLock) public isOwner {
        beneficiaries[_newBeneficiary] = _tokensToLock;
    }

    function vestingTokens(address beneficiary) public view cliffPeriodDone returns (uint) {
        uint tokensToBeVested = 0;
        uint totalVestingTokens = beneficiaries[beneficiary];

        if (block.timestamp < cliff) {
            return tokensToBeVested;
        } else {
            uint timeSinceStart = block.timestamp - startTime;
            uint noOfPeriodsSinceStart = timeSinceStart / slicePeriod;
            uint totalPeriods = duration / slicePeriod;

            if (noOfPeriodsSinceStart >= totalPeriods) {
                tokensToBeVested = totalVestingTokens - noOfVestedTokens[beneficiary];
            } else {
                uint tokensVestedInOnePeriod = totalVestingTokens / totalPeriods;
                tokensToBeVested = tokensVestedInOnePeriod * noOfPeriodsSinceStart;
            }
        }

        uint alreadyVestedTokens = noOfVestedTokens[beneficiary];
        uint remainingTokens = totalVestingTokens - alreadyVestedTokens;
        uint vestingAmount = tokensToBeVested - alreadyVestedTokens;

        if (vestingAmount > remainingTokens) {
            vestingAmount = remainingTokens;
        }

        return vestingAmount;
    }

    function release() public isBeneficiary cliffPeriodDone {
        uint amount = vestingTokens(msg.sender);

        require(amount > 0, "No tokens to release");

        noOfVestedTokens[msg.sender] += amount;
        tokensReleased += amount;

        token.transfer(msg.sender, amount);
    }

    function getContractBalance() public view returns (uint) {
        return token.balanceOf(address(this));
    }
}
